import React, { useContext } from 'react';
import { ThemeContext } from '../contexts/ThemeContext';
import themeIcon from '../IMAGES/sol-luna.png'; // Asegúrate de que la ruta sea correcta

const Header = () => {
  const { toggleTheme } = useContext(ThemeContext);

  return (
    <header>
      <h1>Tienda E-commerce</h1>
      <button onClick={toggleTheme} style={{ background: 'none', border: 'none' }}>
        <img src={themeIcon} alt="Cambiar tema" style={{ width: '30px', height: '30px' }} />
      </button>
    </header>
  );
};

export default Header;
